  Route,
  Link
}
from 'react-router-dom';

class Garage extends React.Component{ 
  constructor(props){
    super(props);
    this.state ={
      value: '',
      data: ["apple", "mango", "orange", "purple"]
    };
  }


render(){
  return (
    <ul>
      {this.state.data.map((value, index) => {
        return <li key={index}>{value}</li>
      })}
    </ul>
  )


}

}

